script: |
  super -f text -I q10528.spq | sort > q10528.out

inputs:
  - name: q10528.spq
    data: |
      SELECT col2 col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( + ( + col2 ) ) BETWEEN NULL AND col0 OR col0 + + col0 NOT BETWEEN 13 * col1 + CAST ( - 10 AS REAL ) * 27 AND - col0 + 66;
  - name: tab2

outputs:
  - name: q10528.out
    data: |
      23
      40
      58
